                <Link to="/showcase/project2">
                    Project 2
                </Link>
            </div>
            <TransitionGroup>
                <CSSTransition
                    key={window.location.key}
                    classNames="project"
                    timeout={3000}
                >
                    <Outlet />
                </CSSTransition>
            </TransitionGroup>
            {/* <TransitionGroup component={null}>
